import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const AccountScreen = () => {
  return (
    <View style={{height: 50, border: '1px solid red, '}}>
      <Text>AccountScreen</Text>
    </View>
  )
}

export default AccountScreen

const styles = StyleSheet.create({})
